0438\u0435 (\u043f\u0435\u0440\u0432\u0430\u044f \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043b\u043e\u043d\u0438\u044f \u0432 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1699_%D0%B3%D0%BE%D0%B4\" title=\"1699 \u0433\u043e\u0434\">1699<\/a>&#160;\u2014 \u043d\u0430 \u0440\u0435\u0439\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D1%80%D0%BE%D0%B3\" title=\"\u0422\u0430\u0433\u0430\u043d\u0440\u043e\u0433\">\u0422\u0430\u0433\u0430\u043d\u0440\u043e\u0433\u0430<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u043c\u043e\u0442\u0440-\u043f\u0430\u0440\u0430\u0434 \u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u043c\u0430\u043d\u0451\u0432\u0440\u044b \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1772_%D0%B3%D0%BE%D0%B4\" title=\"1772 \u0433\u043e\u0434\">1772<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B7%D0%B4%D0%B5%D0%BB%D1%8B_%D0%A0%D0%B5%D1%87%D0%B8_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%BE%D0%B9\" title=\"\u0420\u0430\u0437\u0434\u0435\u043b\u044b \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439\">\u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0437\u0434\u0435\u043b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%87%D1%8C_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B0%D1%8F\" title=\"\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f\">\u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775_%D0%B3%D0%BE%D0%B4\" title=\"1775 \u0433\u043e\u0434\">1775<\/a>&#160;\u2014 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u00abSan Carlos\u00bb \u0432\u043e\u0448\u043b\u043e \u0432 \u0431\u0443\u0445\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA%D0%BE\" title=\"\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e\">\u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a\u043e<\/a>. \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B9%D0%B0%D0%BB%D0%B0,_%D0%A5%D1%83%D0%B0%D0%BD_%D0%B4%D0%B5\" title=\"\u0410\u0439\u0430\u043b\u0430, \u0425\u0443\u0430\u043d \u0434\u0435\">\u0425\u0443\u0430\u043d \u0434\u0435 \u0410\u0439\u0430\u043b\u0430<\/a> \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u043f\u0440\u0438\u0431\u044b\u0432\u0448\u0438\u043c \u0441\u044e\u0434\u0430 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0446\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d