" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u044b<\/a> \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1890_%D0%B3%D0%BE%D0%B4\" title=\"1890 \u0433\u043e\u0434\">1890<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044f \u0441\u043e\u0433\u043b\u0430\u0441\u0438\u043b\u0430\u0441\u044c \u043f\u0440\u0438\u0437\u043d\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B4%D0%B0%D0%B3%D0%B0%D1%81%D0%BA%D0%B0%D1%80_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440 (\u043e\u0441\u0442\u0440\u043e\u0432)\">\u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440<\/a> \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u044b \u043f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D1%87%D0%B5%D0%BA\" title=\"\u0414\u043e\u0440\u043e\u0436\u043d\u044b\u0439 \u0447\u0435\u043a\">\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0435 \u0447\u0435\u043a\u0438<\/a> (\u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/American_Express\" title=\"American Express\">American Express<\/a>\u00bb).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0