043a\u043e\u0432 \u041c\u043e\u0434\u0435\u0441\u0442\u043e\u0432\u0438\u0447\">\u042f\u043a\u043e\u0432\u0430 \u0413\u0430\u043a\u043a\u0435\u043b\u044f<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u043f\u0435\u0440\u0432\u043e\u0439 \u043e\u0447\u0435\u0440\u0435\u0434\u0438 \u0426\u041f\u041a\u0438\u041e \u0432 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0431\u043e\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B8_%D0%BD%D0%B0_%D0%A5%D0%B0%D0%BB%D1%85%D0%B8%D0%BD-%D0%93%D0%BE%D0%BB%D0%B5\" title=\"\u0411\u043e\u0438 \u043d\u0430 \u0425\u0430\u043b\u0445\u0438\u043d-\u0413\u043e\u043b\u0435\">\u0425\u0430\u043b\u0445\u0438\u043d-\u0413\u043e\u043b\u0435<\/a> \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u043b\u0451\u0442\u0447\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D1%8E%D0%BA%D0%B8%D0%BD,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%90%D0%BD%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u042e\u044e\u043a\u0438\u043d, \u041c\u0438\u0445\u0430\u0438\u043b \u0410\u043d\u0438\u0441\u0438\u043c\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u042e\u044e\u043a\u0438\u043d<\/a> \u043f\u0435\u0440\u0432\u044b\u043c \u0432 \u043c\u0438\u0440\u0435 \u043d\u0430\u043f\u0440\u0430\u0432\u0438\u043b \u0433\u043e\u0440\u044f\u0449\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u043d\u0430 \u043d\u0430\u0437\u0435\u043c\u043d\u0443\u044e \u0446\u0435\u043b\u044c \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\