0434\">1941<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_(1941)\" title=\"\u041e\u0434\u0435\u0441\u0441\u043a\u0430\u044f \u043e\u0431\u043e\u0440\u043e\u043d\u0430 (1941)\">\u0433\u0435\u0440\u043e\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043e\u0431\u043e\u0440\u043e\u043d\u0430 \u041e\u0434\u0435\u0441\u0441\u044b<\/a>, 5 \u0430\u0432\u0433\u0443\u0441\u0442\u0430&#160;\u2014 16 \u043e\u043a\u0442\u044f\u0431\u0440\u044f 1941 \u0433&#160;\u2014 73 \u0434\u043d\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4_%D0%BF%D0%B5%D1%80%D0%B2%D0%BE%D0%B3%D0%BE_%D1%81%D0%B0%D0%BB%D1%8E%D1%82%D0%B0\" title=\"\u0413\u043e\u0440\u043e\u0434 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0441\u0430\u043b\u044e\u0442\u0430\">\u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u0431\u0435\u0434\u043d\u044b\u0439 \u0441\u0430\u043b\u044e\u0442<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b&#160;\u2014 12 \u0437\u0430\u043b\u043f\u043e\u0432 \u0438\u0437 124 \u043e\u0440\u0443\u0434\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B4%D0%BE%D1%82%D0%BE%D0%B2,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0435\u0434\u043e\u0442\u043e\u0432, \u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0439 \u0424\u0435\u0434\u043e\u0442\u043e\u0432<\/a> \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0444\u0443\u0442\u0431\u043e\u043b\u0438\u0441\u0442\u043e\u043c, \u0437\u0430\u0431\u0438\u0432\u0448\u0438\u043c \u0441\u0442\u043e \u043c\u044f\u0447\u0435\u0439 \u0432 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430\u0445 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949_%D0%B3%D0%BE%D0%B4\" title=\"1949 \u0433\u043e\u0434\">1949<\/a>&#160;\u2014 \u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u043a\u0438\u043d\u043e\u0437\u0432\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B3%D0%BC%D0%B0%D0%BD,_%D0%98%D0%BD%D0%B3%D1%80%D0%B8%D0%B4\" title=\"\u0411\u0435\u0440\u0433\u043c\u0430\u043d, \u0418\u043d\u0433\u0440\u0438\u0434\">\u0418\u043d\u0433\u0440\u0438\u0434 \u0411\u0435\u0440\u0433\u043c\u0430\u043d<\/a> \u0441\u043e\u043e\u0431\u0449\u0438\u043b\u0430, \u0447\u0442\u043e \u043e\u043d\u0430 \u00ab\u043d\u0435 \u0441\u0432\u044f\u0442\u0430\u044f\u00bb \u0438 \u0438\u0437\u043c\u0435\u043d\u044f\u043b\u0430 \u0441\u0432\u043e\u0435\u043c\u0443 \u043c\u0443\u0436\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BC%D0%B8%D0%BF%D0%B0%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D1%81%D0%BF%D1%8B%D1%82%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D0%B8%D0%B3%D0%BE%D0%BD\" title=\"\u0421\u0435\u043c\u0438\u043f\u0430\u043b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u0438\u0441\u043f\u044b\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u043e\u043b\u0438\u0433\u043e\u043d\">\u0421\u0435\u043c\u0438\u043f\u0430\u043b\u0430\u0442\u0438\u043d\u0441\u043a\u043e\u043c \u043f\u043e\u043b\u0438\u