0443\u043f\u043f\u0430 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c\u043e\u0432. \u041d\u0435\u0431\u0435\u0441\u043d\u043e\u0435 \u0442\u0435\u043b\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0441\u043e\u0441\u0435\u0434\u043d\u0435\u0439 \u0437\u0432\u0451\u0437\u0434\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u0438 \u0432\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u043a\u0440\u0443\u0433 \u0437\u0432\u0435\u0437\u0434\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BF%D1%81%D0%B8%D0%BB%D0%BE%D0%BD_%D0%AD%D1%80%D0%B8%D0%B4%D0%B0%D0%BD%D0%B0\" title=\"\u042d\u043f\u0441\u0438\u043b\u043e\u043d \u042d\u0440\u0438\u0434\u0430\u043d\u0430\">\u042d\u043f\u0441\u0438\u043b\u043e\u043d \u042d\u0440\u0438\u0434\u0430\u043d\u0430<\/a>. \u041f\u043e \u043e\u0446\u0435\u043d\u043a\u0430\u043c \u0443\u0447\u0451\u043d\u044b\u0445, \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u043d\u0430\u044f \u043f\u043b\u0430\u043d\u0435\u0442\u0430 \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u0433\u0430\u0437\u0430 \u0438 \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0430\u043c \u043f\u0440\u0435\u0432\u044b\u0448\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BF%D0%B8%D1%82%D0%B5%D1%80_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u042e\u043f\u0438\u0442\u0435\u0440 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u042e\u043f\u0438\u0442\u0435\u0440<\/a>&#160;\u2014 \u0441\u0430\u043c\u0443\u044e \u0431\u043e\u043b\u044c\u0448\u0443\u044e \u043f\u043b\u0430\u043d\u0435\u0442\u0443 \u0421\u043e\u043b\u043d\u0435\u0447\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u044b.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u04